import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { authGuard } from './core/guards/auth.guard';
import { CadastrarAdminComponent } from './features/admin/pages/cadastrar-admin/cadastrar-admin.component';

const routes: Routes = [
{ path: '', redirectTo: '/auth/login', pathMatch: 'full' },
{
path: 'auth',
loadChildren: () => import('./features/auth/auth.module').then(m => m.AuthModule)
  },
  {
    path: 'admin',
    loadChildren: () => import('./features/admin/admin.module').then(m => m.AdminModule),
    canActivate: [authGuard],
    data: { roles: ['ADMIN'] }
  },
  {
    path: 'cliente',
    loadChildren: () => import('./features/cliente/cliente.module').then(m => m.ClienteModule),
    canActivate: [authGuard],
    data: { roles: ['CLIENTE'] }
  },
  {
    path: 'admin/cadastrar-admin',
    component: CadastrarAdminComponent,
    canActivate: [authGuard],
    data: { roles: ['ADMIN'] }
  },
  { path: '**', redirectTo: '/auth/login' }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule {}
